import React from 'react';

const Lasttrade = ({ tradprich, tradamount, tradtime, isHighlighted }) => {
  return (
    <>
      <tr>
        <td className={`text-theme4 fs-12 ${isHighlighted && 'highlighted'}`}>{tradprich}</td>
        <td className={`text-white fs-12 tradamount ${isHighlighted && 'highlighted'}`}>{tradamount}</td>
        <td className={`text-white fs-12 ${isHighlighted && 'highlighted'}`}>{tradtime}</td>
      </tr>
    </>
  );
};

export default Lasttrade;
